import UserIcon from "@heroicons/react/outline/UserIcon";

function Register() {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    password: "",
    firstName: "",
    lastName: "",
  });
  const { name, email, password, firstName, lastName } = formData;

  const onChange = () => {};
  return (
    <>
      <section>
        <h1 className="h-10 w-10">
          <UserIcon /> Register
        </h1>
      </section>

      <section>
        <form action="POST">
          <input
            type="text"
            id="name"
            name="name"
            value={firstName}
            placeholder="Name"
            onChange={onChange}
          />
        </form>
      </section>
    </>
  );
}

export default Register;
